import React from "react"

function getClassName(skill){
    return "skillbar__bar-" + skill.toLowerCase()
}

function SkillBarCharacter(props){
    const characterSkills = getClassName(props.skill)
    return(
        <div className="skillbarcharacter">
            <div className="skillbar__progressbar">
                <div></div>
            </div>
        </div>
    )
}

export default SkillBarCharacter
